  return (
    <div>
      <h1>Add a New Blog</h1>
      <form>
        <label>Blog Tile:</label>
        <input type="text" required />
        <label>Blog Body:</label>
        <textarea required></textarea>
        <label>Blog author:</label>
        <select>
          <option value="mario">mario</option>
          <option value="yoshi">yoshi</option>
        </select>
      </form>
    </div>
  );
};

